import React from 'react';
import logo from './logo.svg';
import './App.css';
import {ReactComponent as Icon} from './Components/Atoms/Icon/icon.svg'
import TypoIcon from './Components/Atoms/Typography';
import Tag from './Components/Atoms/tag';
import styled from 'styled-components';
import Typography from '@mui/material/Typography'
const AppDiv=styled.div`
box-sizing: border-box;



display: flex;
flex-direction: row;
align-items: center;
padding: 32px;
gap: 12px;
isolation: isolate;

position: absolute;
width: 340px;
height: 259px;
left: 278px;
top: 143px;



background: #201F24;


border: 1px solid #28272B;
border-radius: 12px;`


const InDiv=styled.div`
display: flex;
flex-direction: column;
justify-content: center;
align-items: flex-start;
padding: 0px;
gap: 24px;

width: 276px;
height: 168px;



flex: none;
order: 0;
flex-grow: 1;
z-index: 0;`

const TextDiv=styled.div`
display: flex;
flex-direction: row;
align-items: center;
padding: 0px;
gap: 8px;

width: 164px;
height: 22px;

color:#E8E7F0;
/* Inside auto layout */

flex: none;
order: 0;
align-self: stretch;
flex-grow: 0;`


function App() {
  return (
    <AppDiv>
      <InDiv>
      <Icon ></Icon>
      <TextDiv>
      <TypoIcon></TypoIcon>
      <Typography variant='h6'>$14,204.55</Typography>
      </TextDiv>
      </InDiv>
      <Tag></Tag>
    </AppDiv>
  );
}

export default App;
